Forge supports several different testing constructs. Chiefly: example, for expressing that specific instances should satisfy (or not satisfy) a predicate; assert, for expressing that a predicate should be... sufficient to satisfy another (is sufficient for); necessary for another to be satisfied (is necessary for); is consistent with another, i.e., that the combination of the two predicates can be satisfied by at least one instance (is consistent with); is satisfiable or unsatisfiable (is sat and is unsat). Assertions largely subsume an older testing form, test expect blocks, which are less structured and used mostly within Forge's internal test cases. Note on terminology : we will sometimes refer to tests, particularly assertions of necessity and sufficiency, as property tests . This is because they can be used to express sweeping expectations about predicates, rather than just the point-wise, single-instance expectations that example can. We also sometimes refer to a test as a test of exclusion (if it asserts that some set of instances shouldn't be admitted by a predicate) or test of inclusion (to assert that some set of instances should be admitted, or that such an instance exists). Shared Context All the subsections below contain tests for the same small model of tic-tac-toe: abstract sig Player {}
one sig X, O extends Player {}
sig Board { board: pfunc (Int -> Int) -> Player }
pred wellformed { all b: Board | all row, col: Int | { (row < 0 or row > 2 or col < 0 or col > 2) implies no b.board[row][col] } }

