In case you're curious, we include a very brief sketch of how sigs, fields, etc. relate to Forge's core solver engine. This information might be useful when debugging a tough problem or just for understanding the tool better. Froglet If you are currently working in Froglet, you may see terms in this document that you aren't yet familiar with. Forge's solver engine works entirely in terms of sets , regardless of which Forge language you are using. Each sig name corresponds to the set of atoms of that type in a given instance. Similarly, each field name f corresponds to a relation (set) with arity 1+arity(f). (The extra column in the relation holds the atom the field value belongs to.) Arity The arity of a set is how many elements its member tuples contain. E.g., a set of atoms would have arity 1, but a set of pairs of atoms would have arity 2. E.g., sig B {}
sig A { myField: set A -> B
} is internally represented as a pair of sets A and B and a 3-ary relation named myField that must be a subset of A -> A -> B in any instance.

