Let's get concrete. The concentration requirements for an A.B. in CSCI state that to get an A.B., a student must (among other things) complete a pathway, which comprises two upper-level courses. We might rewrite this as: "Every student who gets an A.B. must have passed two 1000-level courses in the same pathway." If we're modeling concentration requirements, we might decide to create sigs for Student, Course, Pathway, and so on, with fields you'd expect. For example, we might create: sig Student { -- dictionary of grades for courses taken and passed grades: pfunc Course -> Grade
} But this only describes the shape of the data, not the concentration requirements themselves! To do that, we need to create some constraints. The sentence above states a requirement for every student . Generally the department follows this rule. But it's possible to imagine some semester where the department makes a mistake, and gives an A.B. degrees to someone who hadn't actually finished a pathway. The sentence is something that could be true or false in any given semester: "Every student who gets an A.B. must have passed two 1000-level courses in the same pathway." In Forge, we'd write this for-all using a quantifier: all s: Student | ... Then we have a condition that triggers a requirement: if a student has gotten an A.B., then something is required. In Forge, this becomes an implication inside the quantifier: all s: Student | s.degreeGranted = AB implies {...} Let's look more closely at the part we wrote: s.degreeGranted = AB. For a given student, that is also either true or false. But something important is different inside the =: s.degreeGranted doesn't denote a boolean, but rather an atom in some instance (which will perhaps be equal to AB). These are very different kinds of syntax. A similar thing is true for s, course1, and course2. Let's finish writing the constraint and then color-code the different parts: all s: Student | s.degreeGranted = AB implies { some disj course1, course2: Course | course1.pathway = course2.pathway
} The green syntax is about whether something is true or false. The red syntax is about identifying specific atoms in an instance. By using both kinds of syntax, you can express constraints about the shape of instances. without boolean-valued syntax, you couldn't express implications, "or", "and", etc. without atom-valued syntax, you could only talk about abstract boolean values, not actual atoms in the world.

