^<expr> returns the transitive closure of <expr>, assuming it is has arity 2. Attempting to apply ^ to a relation of different arity will produce an error. The transitive closure of a binary relation $r$ is defined as the smallest relation $t$ such that: r in t; and for all a, b, and c, if a->b is in t and b->c is in t, then a->c is in t. Informally, it is useful to think of ^r as encoding reachability using r. It is equivalent to the (unbounded and thus inexpressible in Forge) union: r + r.r + r.r.r + r.r.r.r + .... Transitive Closure If roads is a binary relation between City and itself, and Providence is a city: sig City { roads: set City
}
one sig Providence extends City {} then ^roads is the reachability relation between cities.

