Instance bounds allow you to encode specific partial instances that you want Forge to run on. When creating an instance bound, you give upper and lower bounds in terms of concrete objects, not numeric sizes. This allows you to test your predicates on a specific instance, which can be convenient (see Examples ). It is also useful for optimization in some cases (see Partial Instances , which use the same bounds syntax as examples). A partial instance If we have defined a single sig with a single field: sig Person { spouse: lone Person
} then this inst describes an instance for our model: inst exampleInstance { Person = `Person0 + `Person1 + `Person2 spouse = `Person0 -> `Person1 + `Person1 + `Person0
} Similarly, we could write an example using the same syntax (assuming that marriageRules is defined as a predicate): example myExample is {marriageRules} for { Person = `Person0 + `Person1 + `Person2 spouse = `Person0 -> `Person1 + `Person1 + `Person0
} Note that Forge expects concrete object names to be prefixed with a backquote; this is mandatory, and used to distinguish object names (which only make sense in the context of an instance or instances) from sigs, fields, predicates, and other kinds of identifiers that make sense in arbitrary formulas. Instances defined via inst can be used in run, assert, etc. and may be combined with numeric bounds, provided they are consistent. Bounds annotations, such as is linear, can be included in instance bounds as well. See the Concrete Instances section for more information about writing instance bounds. Using Instance Bounds You may give the entire instance bound verbatim: run {} for 3 Int for { Person = `Person0 + `Person1 + `Person2 spouse = `Person0 -> `Person1 + `Person1 + `Person0
} or you may use the instance name directly: run {} for 3 Int for exampleInstance
